import React from 'react'

export const Login = () => {
  return (
    <div className='auth'>
      <h1>LOGIN</h1>
      <form>
        <input type='text' placeholder='username'></input>
        <input type='password' placeholder='password'></input>
        <button>Login</button>
      </form>
    </div>
  )
}
